import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Box from '@material-ui/core/Box';

const files = [
    { name: "file1", info: "file1 info" },
    { name: "file2", info: "file2 info" },
    { name: "file3", info: "file3 info" },
    { name: "file4", info: "file4 info" },
];

// function ListItemLink(props) {
//     return <ListItem button component="a" {...props} />;
// }
// <ListItemLink href="#simple-list"> <ListItemText primary="File" /></ListItemLink>

const fileList = files.map((file, i) => {
    <ListItem key={i} button><ListItemText primary={file.name}/></ListItem>
});

const useStyles = makeStyles((theme) => ({
    root: {
        width: '100%',
        maxWidth: 360,
        borderRadius: '4px',
        overflow: 'auto',
    },
}));





export default function FileList() {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Box bgcolor="primary.main" height={535}>
                <List component="nav">
                    {/* <ListItem button>
                        <ListItemText primary="File" />
                    </ListItem>
                    <ListItemLink href="#simple-list">
                        <ListItemText primary="File" />
                    </ListItemLink> */}
                    {fileList}
                </List>
            </Box>
        </div>
    );
}
